import http from '../http-common.js';

class UserDataService {
    getAll() {
        return http.get('/');
    }

    createUser(data) {
        return http.post('/', {
            body: data
        });
    }

    findUser(query) {
        return http.get("/", query);
    }
}

export default new UserDataService();
